function gcf(a, b) {
  let g = 0;
  for (let i = 0; i < a.length; i++) {
    for (let j = 0; j < b.length; j++) {
      if (a[i] > b[j]) {
        g = Math.max(g, a[i] * b[j]);
      }
    }
  }
  return g;
}
